DROP TABLE IF EXISTS #ss3

CREATE TABLE #ss3
( siid INT IDENTITY (1,1),
coiid VARCHAR(240),
Alfalfa	REAL,	Barley	REAL,	Corn	REAL,	[Grass-Legume-Hay] REAL,		Hay	REAL,	Oats	REAL,	Rye	REAL,	Sorghum	REAL,	Soybeans	REAL,	Wheat REAL

CONSTRAINT pk_ss3 PRIMARY KEY CLUSTERED (siid)
);



