--SELECT * FROM #ss3


SELECT TOP 100 areasymbol, component.compname AS NASIS_Compname, component.localphase AS NASIS_Localphase, c.compname AS SDA_Compname, c.localphase AS SDA_Localphase, m.muname, lmapunitiid, m.mukey, #ss3.coiid AS wv_coiid_list, component.coiid, c.cokey, Alfalfa	,	Barley	,	Corn	,	[Grass-Legume-Hay] ,		Hay	,	Oats	,	Rye	,	Sorghum	,	Soybeans	,	Wheat 
FROM (areatype with(nolock)
INNER JOIN (area with(nolock) INNER JOIN legend with(nolock) ON legend.areaiidref=area.areaiid  AND legendsuituse = 3
						) ON areatype.areatypeiid=area.areatypeiidref 
			AND LEFT(area.areasymbol,2) = 'WV' AND areatype.areatypename = 'Non-MLRA Soil Survey Area')

INNER JOIN (lmapunit with(nolock) INNER JOIN mapunit with(nolock) ON lmapunit.muiidref = mapunit.muiid 
			AND mustatus IN (2,3)) ON lmapunit.liidref = legend.liid

INNER JOIN (correlation  with(nolock) INNER JOIN datamapunit with(nolock)  ON correlation.dmuiidref = datamapunit.dmuiid
			AND repdmu = 1) ON correlation.muiidref=mapunit.muiid
INNER JOIN component with(nolock) ON component.dmuiidref=datamapunit.dmuiid
LEFT OUTER JOIN #ss3 with(nolock) ON #ss3.coiid=component.coiid
INNER JOIN [sdmONLINE].[dbo].[mapunit] AS m ON m.mukey=lmapunit.lmapunitiid
INNER JOIN [sdmONLINE].[dbo].[component] AS c ON c.mukey=m.mukey AND c.majcompflag = 'yes' AND  --c.compname = component.compname
c.compname COLLATE SQL_Latin1_General_CP1_CI_AS = component.compname COLLATE SQL_Latin1_General_CP1_CI_AS
AND c.localphase COLLATE SQL_Latin1_General_CP1_CI_AS = component.localphase COLLATE SQL_Latin1_General_CP1_CI_AS

